#include <stdc++.h>


using namespace std;

bool isPalindrome(string s){
        for (int i = 0; i < s.size() / 2; ++i)
            if (s[i] != s[s.size() - 1 - i]) return false;
        return true;
    }

int main(){
    string inputStr = "";
    cout << isPalindrome(inputStr) << endl;
    return 0;
}